window.bookSummaryJSON = "<p><b>Killing monsters. Quaffing potions. Completing quests. And solving mysteries.</b></p> <p>Azure and the gang discover the Keeper's identity and begin their ultimate quest of collecting all the Stones of Blessing. There will be more than a few hiccups along the way, though, literal ones.</p> <p>A drinking quest has Azure and the gang testing their mettle against a bunch of ale-swilling dwarves. Who has the highest alcohol tolerance? Find out in this exciting installment of the best-selling LitRPG series, the Realm Between.</p>"; 
